INSERT INTO `feed` (`feed_id`, `address`, `content`, `file_path`, `file_type`, `latitude`, `location`, `longitude`, `date`, `sequence`, `article_id`) VALUES
	(27, '경기 수원시 팔달구 우만동 248', '수원 여행의 첫번재 코스는 절에 가서 새해를 뜻깊게 맞이하려고 다녀왔어요. 실은 그것보단 거리상 이 코스가 제일 잘 맞을 것 같아 다녀왔어요.', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/e2631798-feed.png', '', 37.2914820379466, '봉녕사', 127.037464441138, 1, 1, 14),
	(28, '경기 수원시 팔달구 남창동 6-2', '눈이 오면 정말 나가기 싫을 수 있으나 저와 같은 풍경을 보고 싶은 수원 근교 거주자들은 꼭 나가서 관람하고 오시길 추천드릴게요.', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/264acaab-feed.png', '', 37.28191449905621, '화성행궁', 127.01404118510901, 1, 2, 14),
	(29, '경기 수원시 팔달구 매향동 151', '적극 추천드리며 겨울이 아니면 피크닉을 즐길 수 있는 여유의 공간이기에 더욱 더 추천드려요!', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/9ae8170f-feed.png', '', 37.287505800070726, '방화수류정', 127.01807378117873, 1, 3, 14),
	(30, '경기 수원시 팔달구 지동 380', '수원은 남문시장이 유명하더라구요. 마치 시장이지만 여러개의 브랜드가 모인 편집샵같아요. 그래서 이곳도 여러개의 시장이 모여 하나를 이루는 구조랍니다.', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/be2794e2-feed.png', '', 37.27546918387393, '못골종합시장', 127.02126744710107, 1, 4, 14),
	(31, '경기 수원시 영통구 영통동 960-1', '이날 폭설이 내려서 예기치못하게 생각보다 힘들더라구요. 그럼에도 롯데마트에 하루를 보낼 맛있는 식량들은 잘 구매할 수 있었어요!', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/e13d2815-feed.png', '', 37.25292507243592, '롯데마트 영통점', 127.07180216999025, 1, 5, 14),
	(32, '경기 용인시 기흥구 고매동 539-1', '드디어 도착한 수원 여행 중에서의 온전한 휴식시간이에요.', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/69417718-feed.png', '', 37.2273563142298, '캠프레이크', 127.100069908373, 1, 6, 14),
	(33, '경기 수원시 장안구 천천동 430', '저는 무엇보다 온실의 스타일이 이곳이 가장 마음에 들었어요! 그래서 더욱 행복한 수원 식물원 타임이었나봐요.', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/ccff66ad-feed.png', '', 37.28779227367441, '일월수목원', 126.97647591542294, 2, 1, 14),
	(34, '경기 수원시 팔달구 북수동 15-1', '브런치를 먹을까 고민하다 메뉴를 포기하고 오게 된 피자집이에요. 넉넉한 크기와 누구나 좋아할듯한 먹거리와 눈길가는 느낌이 확연히 다르니까요!', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/82cdffd1-feed.png', '', 37.28795128322583, '백스트리트피자', 127.01546097217603, 2, 2, 14),
	(35, '서울 종로구 창신동 611-19', '낙산공원에 놀러갔어요~', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/ac5c5367-KakaoTalk_20240215_161524906.jpg', '', 37.579691878115554, '낙산공원', 127.01044475881706, 1, 1, 15),
	(36, '서울 용산구 이태원동 119-23', '할로윈에 이태원 거리에서 아이언맨 발견', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/0efba368-KakaoTalk_20240215_161524906_01.jpg', '', 37.534561306656094, '이태원거리', 126.99580922812, 1, 2, 15),
	(37, '서울 중구 정동 5-1', '덕수궁 돌담길을 걷다 덕수궁으로 들어갔다.', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/69d29241-KakaoTalk_20240215_161524906_05.jpg', '', 37.5655638710672, '덕수궁', 126.97489475498901, 2, 1, 15),
	(38, '서울 종로구 종로4가 165-11', '광장시장에서 유명한 부촌 육회에서 반주를..', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/7d78a9cf-KakaoTalk_20240215_161524906_04.jpg', '', 37.5703778574977, '부촌육회', 126.99993208243198, 2, 2, 15),
	(39, '서울 관악구 봉천동 1601-22', '저녁이지만 브런치 먹으러 사담으로 갔어요', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/16f51552-KakaoTalk_20240215_161524906_06.jpg', '', 37.47988005042745, '사담', 126.95559031095974, 2, 3, 15),
	(40, '서울 마포구 서교동 364-10', '점심에는 홍대에 있는 오코노미야끼 맛집 우와를 갔습니다.', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/063aa390-KakaoTalk_20240215_161524906_07.jpg', '', 37.5516835548182, '우와 홍대본점', 126.922172337916, 3, 1, 15),
	(41, '서울 마포구 망원동 394-101', '점심을 먹고 망원동 에스프레소 바에 갔습니다. 자리가 없어 밖에서 먹음..', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/2cf39624-KakaoTalk_20240215_161524906_03.jpg', '', 37.5526691539486, '콜트 커피바', 126.90595191408198, 3, 2, 15),
	(42, '서울 마포구 동교동 164-1', '마라샹궈는 역시 마라공방', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/2bcda6e4-KakaoTalk_20240215_161524906_10.jpg', '', 37.55648205778569, '마라공방 홍대입구역직영점', 126.92462550641248, 3, 1, 16),
	(43, '서울 마포구 서교동 401-12', '술 한잔 마셨습니다... 프로젝트가 잘 안되도 좋습니다. 하지만 나루 하나만 기억해주세요...', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/d7cd5299-KakaoTalk_20240215_161524906_02.jpg', '', 37.5489587812498, '와인어클락', 126.91925781551888, 3, 2, 16),
