	(139, '부산 부산진구 전포동 682', '그 유명하다는 전포 카페거리. 서면역에서 노래에서 전포 카페거리 어쩌구 그러던게 생각나서 들러봤습니다. 아쉽지만 홍대가 더 재미있습니다. 서울 짱', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/225cee1b-feed.png', '', 35.1554466988384, '전포카페거리', 129.06256936376738, 1, 3, 44),
	(140, '부산 수영구 광안동 200-4', '아침에 일어나 커피 한잔(사실 아포가토 먹음ㅎㅎ)을 하며 바다 냄새를 맡았습니다. 왼쪽 커피는 리스트레토였나 했는데 그냥 그랬음', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/42a03d7e-feed.png', '', 35.1505714847838, '까사부사노 광안점', 129.11595445244214, 2, 1, 44),
	(141, '부산 수영구 남천동', '요트를 타고 광안대교 밑을 지나갔습니다. 놀이기구를 못 타는 전 너무나 무서운 나머지 호호깔깔 웃고 떠드는 사람들 사이에서 (부끄럽게도) 소리를 지르고 말았습니다. ', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/6da123df-feed.png', '', 35.136691424609396, '광안대교', 129.11691150150264, 2, 2, 44),
	(142, '부산 수영구 수영동 481-2', '그렇게 유명하다는 마린시티를 지나갔습니다. 요트에서 올려다보는데 멋있더군요. 사람들은 난간에 붙어서 사진을 찍어댔지만 전 소심하게 요트에 딱 달라붙은 채 저만치 멀리서 사진을 찍었습니다. 부끄럽습니다.', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/90e05ef9-feed.png', '', 35.17212547743401, '마린시티', 129.11624848521865, 2, 3, 44),
	(143, '부산 수영구 민락동 181-56', '광어 무슨 고노와단가 하는 광어 내장이랑 타다끼를 시켰는데 내장이라 비린내는 어쩔 수 없는 걸까요. 전 먹기 힘들었어요. 하지만 실패하지 않는 메뉴 타다끼 맛있었습니다.', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/5b63e553-feed.png', '', 35.15685370308991, '광안태양', 129.1256634767187, 2, 4, 44),
	(144, '부산 북구 덕천동 432-17', '오마카세로 마무리를 했습니다. 나쁘진 않았지만 대체로 밥이랑 간이 짜네요.. 속이 좀 안 좋아졌어요.', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/2c20ebc1-feed.png', '', 35.20859585721525, '스시쿠도쿠', 129.0083042143886, 3, 1, 44),
	(145, '부산 강서구 대저2동 2350', '다시 집으로 가는 중..', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/2cae5e9f-feed.png', '', 35.17319970265189, '김해국제공항', 128.94672873774698, 3, 2, 44),
	(146, '충북 단양군 단양읍 도전리 615', '배가 고파서 패러글라이딩하러 가기 전 단양 구경시장에 들러 떡갈비와 만두를 사먹었습니다. 맛은 좋았습니다.', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/4b454b4a-feed.png', '', 36.98249105050287, '단양구경시장', 128.36998217032937, 1, 1, 45),
	(147, '충북 단양군 단양읍 고수리 166', '패러글라이딩에서 한 장 찍었습니다. 경치 좋죠. 패러글라이딩.. 좀 긴장했는데 별거 없었습니다. 하지만 착륙 전 같이 탄 가이드 분께서 패러슈트를 이리저리 흔드는 바람에 부끄럽게도 소리를 꺄아악 질러버렸습니다.', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/30e82fcd-feed.png', '', 36.9851719499407, '단양양방산패러글라이딩', 128.37695665499217, 1, 2, 45),
