	(149, '서울 강남구 대치동 897-9', '비싸지만 맛있음. 청어알 소스 필수.', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/90671d28-feed.png', '', 37.502799170161, '돈그리아', 127.05064342127699, 1, 2, 46),
