	(151, '서울 강남구 대치동 900-24', '맛있음. 참숯에 구워줌.', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/e583bad3-feed.png', '', 37.50290383129168, '땅코참숯구이 선릉점', 127.05237835376317, 1, 4, 46),
	(152, '강원특별자치도 강릉시 포남동 1072-7', '여기 장칼국수가 그리 유명하대서 다녀왔습니다. 장칼국수는 제 취향이 아닌가봅니다.', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/76926560-feed.png', '', 37.77330052721161, '금천칼국수', 128.91220542621636, 1, 1, 47),
	(153, '강원특별자치도 강릉시 견소동 286-10', '푸른 바다를 보고 있으니 힐링이 되는 느낌입니다. 아주 좋아요^~^', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/6cf4d114-feed.png', '', 37.77226175953761, '안목해변', 128.9482754051378, 1, 2, 47),
	(154, '강원특별자치도 강릉시 견소동 168', '여기는 강릉이면서 무슨 커피가 이렇게 비싼 것일까요. 뷰가 좋으니 일단 봐드리지만 다음은 없습니다.', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/e124c3eb-feed.png', '', 37.77204572857532, '보사노바 커피로스터스 강릉점', 128.94782940821176, 2, 1, 47),
	(155, '서울 마포구 서교동 364-10', '미안하다 이거 보여주려고 어그로 끌었다. 우와 오코노미야끼 수준 실화냐', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/1ad2cb4a-feed.png', '', 37.5516835548182, '우와 홍대본점', 126.922172337916, 1, 1, 48),
