	(159, '세종특별자치시 전동면 송성리 9', '50여 년간 가꾸어온 식물과 동물들이 자라 숲과 군락을 이룬 베어트리파크', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/39559e8f-feed.png', '', 36.67198590355357, '베어트리파크', 127.21011242055079, 1, 2, 50),
	(160, '세종특별자치시 연서면 고복리 산 36-1', '벚꽃 필 무렵은 아는 사람만 아는 숨겨진 명소', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/3f775bfa-feed.png', '', 36.60826008253011, '고복자연공원', 127.2389357862106, 1, 3, 50),
	(161, '세종특별자치시 금남면 도남리 2-2', '울창한 숲 속의 산책로를 떠올리게 하는 휴양림이라기 보다는 잘 정비된 도로위에 산림 박물관, 수목원, 온실, 연못, 야생동물원 등 다양한 볼거리들이 산재해있는 테마파크 ', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/59808e40-feed.png', '', 36.434137033068396, '금강자연휴양림', 127.22954936165344, 1, 4, 50),
	(162, '서울 강남구 개포동 186-17', '사장님이랑 친하게 지내세요. 아니면 겁나게 잘 먹던가요. 뭐라도 더 주심.', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/3349b6ec-feed.png', '', 37.48936514111491, '연스시', 127.068855477868, 1, 1, 51),
