	(170, '전남 보성군 보성읍 봉산리 1288-1', '맛과 향이 야생차와 같은 유기농의 고급 녹차가 생산되고 있으며, 녹차 밭은 마치 녹색의 카펫을 깔아놓은 듯 장관을 이루어 사계절 내내 관광객이 방문하는 유명 관광지', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/cafe0825-feed.png', '', 34.7156527529844, '대한다원 본사', 127.07877484232701, 1, 4, 52),
	(171, '전남 보성군 회천면 동율리 678', '대한다원 등이 유명한 관광지가 되면서 연계한 해수욕장', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/a3a2bda3-feed.png', '', 34.67002619469291, '율포해수욕장', 127.08902041487755, 2, 1, 52),
