	(185, '충남 태안군 안면읍 정당리 178-7', '바다 위를 건너 만나는 이국적인 분위기의 사찰', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/948e7b77-feed.png', '', 36.5593480287007, '안면암', 126.375062567838, 2, 5, 55),
	(186, '충남 태안군 안면읍 승언리 339-285', '안면도의 꽃', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/e4549234-feed.png', '', 36.497182079394506, '꽃지해수욕장', 126.336020530277, 2, 6, 55),
	(187, '전북특별자치도 익산시 왕궁면 동용리 641', '진귀한 보석과 화석이 가득한 곳', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/d861734c-feed.png', '', 35.990581009119204, '익산보석박물관', 127.10261889854898, 1, 1, 56),
	(188, '전북특별자치도 익산시 왕궁면 왕궁리 562', '고대 동아시아 왕궁 구조의 모범을 보여주는 왕궁리유적', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/f170c804-feed.png', '', 35.97384571886601, '왕궁리유적', 127.054935250458, 1, 2, 56),
	(189, '전북특별자치도 익산시 금마면 기양리 104-1', '익산 미륵사지의 찬란한 문화를 담다', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/85af2b17-feed.png', '', 36.01082380655706, '국립익산박물관', 127.02746491923894, 1, 3, 56),
	(190, '전북특별자치도 익산시 금마면 기양리 135-18', '전통 순두부식당으로 가족 단위 여행객들은 물론, 현지민들도 많이 찾는 사계절 맛집', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/d878fe61-feed.png', '', 36.0115202367512, '맛동순두부', 127.024319312899, 1, 4, 56),
	(191, '전북특별자치도 익산시 금마면 기양리 32-2', '모든 백성들의 구원을 이루려는 간절한 염원', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/123e05da-feed.png', '', 36.0124162512757, '익산미륵사지', 127.031276915824, 1, 5, 56),
	(192, '전북특별자치도 익산시 영등동 191-1', '문화와 역사가 공존하는 2천년 고도의 도시, 백제의 수도, 보석의 메카 익산에 위치해 익산 최초, 최고의 호텔로 친절하고 정성어린 서비스를 제공하는 고품격 비즈니스 호텔이다.', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/aeeb505e-feed.png', '', 35.9503452570003, '웨스턴라이프호텔', 126.97598541619351, 1, 6, 56),
	(193, '전북특별자치도 익산시 용안면 난포리 313-13', '금강변에 조성된 아름다운 생태습지', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/6945a396-feed.png', '', 36.13397622124286, '용안생태습지공원', 126.92930859456045, 1, 7, 56),
	(194, '전북특별자치도 익산시 황등면 황등리 902-11', '토렴된 밥에 각종 나물이 어우러진 비빔밥', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/048f3a08-feed.png', '', 36.005871926761, '진미식당', 126.94487838349902, 1, 8, 56),
	(195, '제주특별자치도 제주시 외도일동 418-11', '존맛탱. 공항 근처니까 꼭 들리세요. 차에서 먹는 주전부리로 최고.', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/8a7a9d9f-feed.png', '', 33.4925495753769, '제주명품쑥빵보리빵', 126.430653500556, 1, 1, 57),
	(196, '제주특별자치도 제주시 한림읍 동명리 1715', '폐공장에서 카페로 변모한 곳', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/31a47645-feed.png', '', 33.40777177080081, '앤트러사이트 제주한림점', 126.25814964765202, 1, 2, 57),
	(197, '제주특별자치도 제주시 한경면 신창리 301', '숨어있으니 잘 찾아가야 됨. 마감을 빨리 하니 너무 늦지 않게 가세요.', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/23c08ae1-feed.png', '', 33.3497486139127, '3인칭관찰자시점', 126.18119997018302, 1, 3, 57),
	(198, '제주특별자치도 제주시 한경면 신창리 1293-1', '오션뷰의 큰 창문이 유명한 카페. 인생샷 건지려면 낮에 가세요. 난 밤에 가서 못 건짐 ㅠㅠ', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/3ea5d0ed-feed.png', '', 33.3448722920323, '클랭블루', 126.17730111987402, 1, 4, 57),
	(199, '제주특별자치도 제주시 한경면 신창리 1322-1', '풍차 짱 많음. 제주 해안도로 최고', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/6e011035-feed.png', '', 33.343081026740045, '신창풍차해안도로', 126.17420604655737, 1, 5, 57),
	(200, '제주특별자치도 서귀포시 안덕면 사계리 1586-1', '게하지만 그냥 콘도형 숙소. 친구랑 2인실 야무지게 쓰고 옴.', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/23be88e5-feed.png', '', 33.23699167041109, '스테이블 게스트하우스', 126.29936970578, 1, 6, 57),
	(201, '제주특별자치도 서귀포시 안덕면 사계리 522-1', '첫 날 게하에서 추천 받은 고기국수 집. 근처라 좋았고 맛있어서 더 좋았음. 해장하기에도 좋았다.', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/c8653962-feed.png', '', 33.24437894131443, '거멍국수', 126.30440962206518, 2, 1, 57),
	(202, '제주특별자치도 서귀포시 대정읍 상모리', '내 최애사진을 건진 곳..! 남서쪽 가시면 꼭 들리세용~ 날씨 좋아서 산책하기에 너무 좋았음.', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/ccafc7e4-feed.png', '', 33.1968232389213, '송악산둘레길', 126.293075154019, 2, 2, 57),
	(203, '제주특별자치도 서귀포시 안덕면 서광리 1235-1', '미리 체험을 예약하면 더 좋은 경험을 할 수 있답니다~~ 맛있는 차를 많이 마시고 와서 좋았어요.', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/c2298dcd-feed.png', '', 33.30591328662082, '오설록 티뮤지엄', 126.28948929546861, 2, 3, 57),
	(204, '제주특별자치도 서귀포시 안덕면 상천리 380', '건물이 참 이쁘게 생겼었다. 볼거리는,,, 적당히 있었다.', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/0ed937a6-feed.png', '', 33.30377089594179, '본태박물관', 126.39247966305703, 2, 4, 57),
	(205, '제주특별자치도 서귀포시 색달동 1898-1', '마침 부모님도 제주도를 오시는 우연 아닌 우연으로,,, 회를 얻어먹었습니다. 제 친구는 진짜 뽕 뽑았죠 뭐. 여기 맛있었습니다. 퀄리티가 좋았어요.', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/9b152a8f-feed.png', '', 33.26211833560329, '색달바당', 126.413762410209, 2, 5, 57),
	(206, '제주특별자치도 서귀포시 안덕면 사계리 3593-8', '친구 픽 게하였는데,, 좋았습니다. 아직도 이 때 만난 사람들이랑 연락하고 지내요! 새벽 2시까지 정말 재밌게 떠든 기억이 있네요.', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/5d84197a-feed.png', '', 33.249553217685516, '양이주택', 126.322522563947, 2, 6, 57),
	(207, '제주특별자치도 서귀포시 안덕면 사계리 86', '사진 이쁘게 나오는 카페~~', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/704764e9-feed.png', '', 33.239222348615485, '원앤온리', 126.319192490757, 3, 1, 57),
	(208, '제주특별자치도 서귀포시 안덕면 사계리 2820-4', '여긴 양이주택 사장님 픽 맛집..! 진짜 맛있게 먹었다. 갈치조림 짱짱,,,', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/3df0936e-feed.png', '', 33.231468549725705, '춘미향식당', 126.296525689007, 3, 2, 57),
	(209, '제주특별자치도 서귀포시 안덕면 상창리 271', '3월이라 꽃이 너무 없었다 ㅠㅠ', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/615e9c7a-feed.png', '', 33.29033656869422, '카멜리아힐', 126.36819010853146, 3, 3, 57),
	(210, '제주특별자치도 제주시 용담2동 2002', '여행의 마무리는 역시 비행기 사진!', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/4882491b-feed.png', '', 33.5070789578184, '제주국제공항', 126.49276900424401, 3, 4, 57),
	(211, '제주특별자치도 서귀포시 색달동 3039', '수상레저 마니아들이 즐겨찾는 이국적인 해변', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/094e4c20-feed.png', '', 33.2450381505136, '중문색달해수욕장', 126.41149867488902, 1, 1, 58),
	(212, '제주특별자치도 서귀포시 색달동 2889', '인형과 교감할 수 있는 오픈형 체험전시 테마파크', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/9da4c0dc-feed.png', '', 33.25029594575548, '테디베어뮤지엄 제주점', 126.412163077718, 1, 2, 58),
	(213, '제주특별자치도 서귀포시 중문동 2624-1', '볼거리와 체험이 가득한 중문관광단지', 'https://naroubucket.s3.ap-northeast-2.amazonaws.com/bc3c14f0-feed.png', '', 33.2458352639585, '제주중문관광단지', 126.420734158755, 1, 3, 58);
